import { useEffect, useState } from "react";
import { Button, Image, Row, Spin, Tabs } from "antd";
import { UploadOutlined } from "@ant-design/icons";

import ImageCard from "./ImageCard";
import UploadModal from "../UploadForm/UploadModal";

import type { TabsProps } from "antd";
import type { UploadChangeParam } from "antd/es/upload";
import type { RcFile, UploadFile, UploadProps } from "antd/es/upload/interface";

const allFiles = [
  {
    uid: "1",
    name: "Wolf.jpg",
    attachmentType: "savedType",
    attachmentUrl:
      "data:image/jpeg;base64,",
  },
  {
    uid: "2",
    name: "Girl.jpg",
    attachmentType: "savedType",
    attachmentUrl:
      "data:image/jpeg;base64,",
  },
  {
    uid: "3",
    name: "Tiger.jpg",
    attachmentType: "savedType",
    attachmentUrl:
      "data:image/jpeg;base64,",
  },
  {
    uid: "3",
    name: "Earth.jpg",
    attachmentType: "savedType",
    attachmentUrl:
      "data:image/jpeg;base64,",
  },
];

export default function Gallery() {
  const [isUploadModalOpen, setIsUploadModalOpen] = useState(false);
  const [fileList, setFileList] = useState<UploadFile<any>[]>([]);

  const [totalFiles, setTotalFiles] = useState<any[]>([]);

  useEffect(() => {
    if (allFiles) {
      setFileList(allFiles);
    }
  }, []);

  useEffect(() => {
    const transformFiles = async () => {
      if (!fileList) return;
      const transformedFiles = await Promise.all(
        fileList?.map(async (file: any) => {
          return {
            attachmentId: file.uid,
            attachmentName: file.name,
            attachmentUrl: file.attachmentUrl,
            attachmentType: "savedType",
          };
        })
      );
      setTotalFiles(transformedFiles);
    };
    transformFiles();
  }, [fileList]);

  const onChange = (key: string) => {
    console.log(key);
  };

  const items: TabsProps["items"] = [
    {
      key: "1",
      label: <p style={{ fontSize: 18 }}>Community Album</p>,
      children: (
        <Spin spinning={fileList.length === 0}>
          <Row
            gutter={[16, 16]}
            style={{
              maxHeight: "calc(100vh - 164px)",
              minHeight: "160px",
              overflowY: "auto",
              padding: 8,
            }}
          >
            <Image.PreviewGroup>
              {totalFiles?.map((file: any, index: number) => {
                return <ImageCard key={index} attach={file} />;
              })}
            </Image.PreviewGroup>
          </Row>
        </Spin>
      ),
    },
    {
      key: "2",
      label: <p style={{ fontSize: 18 }}>Personal Album</p>,
      children: "Content of my photos",
    },
  ];

  type PositionType = "left" | "right";
  const OperationsSlot: Record<PositionType, React.ReactNode> = {
    left: <></>,
    right: (
      <Button
        type="default"
        style={{ marginRight: 16 }}
        icon={<UploadOutlined />}
        onClick={() => setIsUploadModalOpen(true)}
      >
        Upload File
      </Button>
    ),
  };

  return (
    <>
      <UploadModal
        open={isUploadModalOpen}
        setOpen={setIsUploadModalOpen}
        fileList={fileList}
        setFileList={setFileList}
      />
      <Tabs
        style={{ padding: "8px", borderRadius: 8 }}
        defaultActiveKey="1"
        items={items}
        onChange={onChange}
        tabBarExtraContent={OperationsSlot}
        tabBarGutter={16}
      />
    </>
  );
}
